import React, { Component } from "react";
class Like extends Component {
  render() {
    return (
      <button onClick={() => this.props.onLike()}>
        <i
          class={this.props.liked === true ? "fa fa-heart" : "fa fa-heart-o"}
          aria-hidden="true"
        ></i>
      </button>
    );
  }
}

export default Like;
